import React from 'react';
import './car.css'
import {BrowserRouter as Router, Route} from 'react-router-dom'



import MainAnimation from './mainAnimation';
import BottomAnimation from './bottomAnimation'
import PlayerForm from './player    '




class App extends React.Component{

    render(){
        let redCar = <img src={require("./imagies/auto.png")} style={{
            width:"20%",
            height:"10%"
        }}alt="car" className ="fastCar"/>
        return(
            <div>





            <Router>

                <Route exact path = "/" component={MainAnimation}/>
                <Route  exact path='/'render={() => <BottomAnimation  car ={redCar}/> }/>
                <Route exact path ="/player" component = {PlayerForm}/>
                {/* <Route exact path ="/countryApi" component = {Maps}/> */}

            </Router>


            </div>
        )
    }
}

export default App;
